//水晶花
ServerEvents.blockLootTables(event => {
    event.addBlock("kubejs:hexmedia", table => {
        table.addPool(pool => {
            pool.rolls = 3
            pool.addCondition({
                condition: "minecraft:block_state_property",
                block: "kubejs:hexmedia",
                properties: { age: "2" }
            })
            pool.addItem("hexcasting:amethyst_dust").weight(3).count([3, 5])
            pool.addItem("minecraft:amethyst_shard").weight(2).count([1, 3])
            pool.addItem("hexcasting:charged_amethyst").weight(1).count([0, 1])
        })
        for (let i = 0; i < 3; i++) {
            table.addPool(pool => {
                pool.rolls = 1
                pool.addCondition({
                    condition: "minecraft:block_state_property",
                    block: "kubejs:hexmedia",
                    properties: { age: i.toString() }
                })
                pool.addItem("kubejs:hexmedia_seed")
            })
        }
    })
})

